import React from 'react'
import './Css/ShopCategory.css'
import { ShopContext} from '../constants/ShopContext'
const ShopCategory = () => {
  const {all_products} = useContext(ShopContext)
  return (
    <div className='shop-category'></div>
  )
}

export default ShopCategory
